       .container {

       #showPicker {

       .colorPicker {
           background: #E8E6E0;
           border: 1px solid #BBB;
           -moz-border-radius: .3em;
           border-radius: .3em;
           margin: 1em;
           display: inline-block;
       }
       
       .colorPicker .extras {
           float: right;
           margin: 0.5em;
       }
       
       .colorPicker .extras .currentColorContainer {
           overflow: hidden;
       }
       
       .colorPicker .extras .currentColor {
           float: right;
           width: 65px;
           height: 30px;
           border: 1px solid #BBB;
           -moz-border-radius: .3em;
           border-radius: .3em;
       }
       
       .colorPicker .extras .colorFields {
           margin-top: 0.5em;
           margin-bottom: 0.5em;
       }
       
       .colorPicker .extras .color {
           text-align: right;
       }
       
       .colorPicker .extras .colorFields input {
           width: 40px;
           margin-left: 0.5em;
       }
       
       .colorPicker .extras .hex {
           float: right;
       }
       
       .colorPicker .extras .hex input {
           width: 60px;
       }
       
       .colorPicker .twod {
           float: left;
           margin: 0.5em;
       }
       
       /* main dimensions */
       .colorPicker .twod, .colorPicker .twod .bg {
           width: 240px;
           height: 240px;
       }
       .colorPicker .oned, .colorPicker .oned .bg {
           height: 240px;
       }
       .colorPicker .oned, .colorPicker .oned .bg, .colorPicker .oned .pointer .shape {
           width: 20px;
       }
       
       .colorPicker .twod .bg {
           position: absolute;
       
           /* These seem to cause issues in some browsers, careful!
           border: 1px solid #BBB;
           -moz-border-radius: .3em;
           border-radius: .3em;
           */
       }
       .colorPicker .twod .pointer {
           position: relative;
           z-index: 2;
           width: 8px;
       }
       .colorPicker .twod .pointer .shape {
           position: absolute;
       }
       .colorPicker .twod .pointer .shape1 {
           -webkit-transform: translate(-50%, -50%);
           -ms-transform: translate(-50%, -50%);
           transform: translate(-50%, -50%);
           width: 10px;
           height: 10px;
           border: 2px solid black;
           -moz-border-radius: 5px;
           border-radius: 5px;
       }
       .colorPicker .twod .pointer .shape2 {
           -webkit-transform: translate(-50%, -50%);
           -ms-transform: translate(-50%, -50%);
           transform: translate(-50%, -50%);
           width: 8px;
           height: 8px;
           border: 2px solid white;
           -moz-border-radius: 4px;
           border-radius: 4px;
       }
       
       .colorPicker .oned {
           float: left;
           margin: 0.5em;
       }
       
       .colorPicker .oned .bg {
           border: 1px solid #BBB;
           /*
           -moz-border-radius: .3em;
           border-radius: .3em;
           */
       }
       .colorPicker .oned .pointer {
           position: relative;
           z-index: 2;
       }
       .colorPicker .oned .pointer .shape {
           position: absolute;
           margin-left: -1px;
           margin-top: -4px;

           border: 2px solid black;
           -moz-border-radius: 5px;
           border-radius: 5px;

       .container {

       #showPicker {

       .colorPicker {
           background: #E8E6E0;
           border: 1px solid #BBB;
           -moz-border-radius: .3em;
           border-radius: .3em;
           margin: 1em;
           display: inline-block;
       }
       
       .colorPicker .extras {
           float: right;
           margin: 0.5em;
       }
       
       .colorPicker .extras .currentColorContainer {
           overflow: hidden;
       }
       
       .colorPicker .extras .currentColor {
           float: right;
           width: 65px;
           height: 30px;
           border: 1px solid #BBB;
           -moz-border-radius: .3em;
           border-radius: .3em;
       }
       
       .colorPicker .extras .colorFields {
           margin-top: 0.5em;
           margin-bottom: 0.5em;
       }
       
       .colorPicker .extras .color {
           text-align: right;
       }
       
       .colorPicker .extras .colorFields input {
           width: 40px;
           margin-left: 0.5em;
       }
       
       .colorPicker .extras .hex {
           float: right;
       }
       
       .colorPicker .extras .hex input {
           width: 60px;
       }
       
       .colorPicker .twod {
           float: left;
           margin: 0.5em;
       }
       
       /* main dimensions */
       .colorPicker .twod, .colorPicker .twod .bg {
           width: 240px;
           height: 240px;
       }
       .colorPicker .oned, .colorPicker .oned .bg {
           height: 240px;
       }
       .colorPicker .oned, .colorPicker .oned .bg, .colorPicker .oned .pointer .shape {
           width: 20px;
       }
       
       .colorPicker .twod .bg {
           position: absolute;
       
           /* These seem to cause issues in some browsers, careful!
           border: 1px solid #BBB;
           -moz-border-radius: .3em;
           border-radius: .3em;
           */
       }
       .colorPicker .twod .pointer {
           position: relative;
           z-index: 2;
           width: 8px;
       }
       .colorPicker .twod .pointer .shape {
           position: absolute;
       }
       .colorPicker .twod .pointer .shape1 {
           -webkit-transform: translate(-50%, -50%);
           -ms-transform: translate(-50%, -50%);
           transform: translate(-50%, -50%);
           width: 10px;
           height: 10px;
           border: 2px solid black;
           -moz-border-radius: 5px;
           border-radius: 5px;
       }
       .colorPicker .twod .pointer .shape2 {
           -webkit-transform: translate(-50%, -50%);

           transform: translate(-50%, -50%);
           width: 8px;
           height: 8px;
           border: 2px solid white;
           -moz-border-radius: 4px;
           border-radius: 4px;
       }
       
       .colorPicker .oned {
           float: left;
           margin: 0.5em;
       }
       
       .colorPicker .oned .bg {
           border: 1px solid #BBB;
           /*
           -moz-border-radius: .3em;
           border-radius: .3em;
           */
       }
       .colorPicker .oned .pointer {
           position: relative;
           z-index: 2;
       }
       .colorPicker .oned .pointer .shape {
           position: absolute;
           margin-left: -1px;

           border-radius: 5px;

           display: -ms-flexbox;
           display: -webkit-box;
           display: flex;
           -webkit-box-pack: justify;
           -ms-flex-pack: justify;
           justify-content: space-between;
           background-color: #f4f4f8;
           opacity: 0.93;
           /*#f4f4f8cc*/
           height: 48px;
           padding: 0 10px;
           -ms-flex-align: center;
           -webkit-box-align: center;
           align-items: center;
           border-bottom: 1px solid #D2D6DE;
           border-top: 1px solid #D2D6DE;
       }
       
       .app-icon.app-icon--quest-heart {
           width: 19px;
           height: 17px;
       }
       
       .quest-header .btns-holder .btn {
           color: #3A4357;
       }
       
       .quest-header .btns-holder .btn.action {
           background: #FFCB05;
       }
       
       .quest-header .btns-holder .btn.action:hover {
           background: #f2b900;
       }
       
       .quest-header .btn.action .action__text {
           vertical-align: middle;
           margin-right: -3px;
           padding-right: 0;
           padding-left: 13px;
           max-width: calc(100% - 24px);
       }
       
       .model-holder {
           display: -webkit-box;
           display: -ms-flexbox;
           display: flex;
           -webkit-box-pack: justify;
           -ms-flex-pack: justify;
           justify-content: space-between;
           overflow: auto;
           padding: 0 16px;
           max-width: 85%;
       }
       
       .model-holder span {
           margin-left: 3px;
       }
       
       .oh-snap {
           font-weight: bold;
       }
       
       .model-name, .model-error {
           white-space: nowrap;
       }
       
       .model-desc {
           overflow: hidden;
           white-space: nowrap;
       }
       
       .model-error-holder {
           display: -webkit-box;
           display: -ms-flexbox;
           display: flex;
           -webkit-box-align: center;
           -ms-flex-align: center;
           align-items: center;
           /*margin: 0 auto;*/
       }
       
       .model-error-holder span {
           margin-left: 5px;
       }
       
       .model-desc b {
           color: #3A4357;
       }
       
       .like {
           -webkit-animation-duration: 2s;
           animation-duration: 2s;
           -webkit-animation-fill-mode: both;
           animation-fill-mode: both;
           -webkit-animation-name: bounceOut;
           animation-name: bounceOut;
       }
       
       @-webkit-keyframes bounceOut {
           20% {
           -webkit-transform: scale3d(.9, .9, .9);
           transform: scale3d(.9, .9, .9);
           }
           99% {
           -webkit-transform: scale3d(1.5, 1.5, 1.5);
           transform: scale3d(1.5, 1.5, 1.5);
           }
           to {
           -webkit-transform: scale3d(1, 1, 1);
           transform: scale3d(1, 1, 1);
           color: #FFCB05;
           }
       }
       
       @keyframes bounceOut {
           20% {
           -webkit-transform: scale3d(.9, .9, .9);
           transform: scale3d(.9, .9, .9);
           }
           99% {
           -webkit-transform: scale3d(1.5, 1.5, 1.5);
           transform: scale3d(1.5, 1.5, 1.5);
           }
           to {
           -webkit-transform: scale3d(1, 1, 1);
           transform: scale3d(1, 1, 1);
           color: #FFCB05;
           }
       }
       
       @-webkit-keyframes loader-animation {
           0% {
           width: 0;
           left: 0;
           }
           50% {
           width: 100%;
           left: 0;
           }
           to {
           width: 100%;
           left: 100%;
           }
       }
       
       @keyframes loader-animation {
           0% {
           width: 0;
           left: 0;
           }
           50% {
           width: 100%;
           left: 0;
           }
           to {
           width: 100%;
           left: 100%;
           }
       }
       
       quest-header, quest-loader {
           position: absolute;
           top: 0;
           left: 0;
           z-index: 999;
           width: 100%;
       }
       
       .quest-loader {
           display: -webkit-box;
           display: -ms-flexbox;
           display: flex;
           height: 100%;
       }
       
       .quest-loader .bar {
           position: absolute;
           height: 5px;
           background-color: #FFCB05;
           -webkit-animation: loader-animation 3s infinite;
           animation: loader-animation 3s infinite;
       }
       
       .quest-loader .loading {
           -ms-flex-item-align: center;
           align-self: center;
           color: #3A4357;

       /*************************** step 1 ***************************/
       
       .file-container {
           display: -webkit-box;
           display: -ms-flexbox;
           display: flex;
           -webkit-box-orient: vertical;
           -webkit-box-direction: normal;
           -ms-flex-direction: column;
           flex-direction: column;
           -webkit-box-align: center;
           -ms-flex-align: center;
           align-items: center;
           -webkit-box-pack: center;
           -ms-flex-pack: center;
           justify-content: center;
           text-align: center;
           height: 144px;
           background-color: #F4F4F8;
           outline: 1px dashed #CBCED7;
           outline-offset: 5px;
           margin: 0 35px;
       }
       
       .file-container .file-info {
           color: #9EA2AB;
           margin: 5px 0;
       }
       
       .file-container span.file-info {
           font-size: 14px;
       }
       
       .dragging {
           background-color: #dadade;
           outline: 1px dashed #dadade;
       }
       
       #labelUpload {
           color: #1FAFF3;
           text-decoration: none;
           cursor: pointer;
       }
       
       #labelUpload:hover {
           text-decoration: underline;
       }
       
       #fileUpload {
           display: none;
       }
       
       /*************************** step 2 ***************************/
       
       .vis-container {
           display: -webkit-box;
           display: -ms-flexbox;
           display: flex;
           -webkit-box-pack: justify;
           -ms-flex-pack: justify;
           justify-content: space-between;
           margin: 40px 30px 12px 30px;
       }
       
       .vis-container.titles {
           margin: 15px 30px;
       }
       
       .numeric-container, .unstructured-container {
           display: -webkit-box;
           display: -ms-flexbox;
           display: flex;
           -webkit-box-pack: justify;
           -ms-flex-pack: justify;
           justify-content: space-between;
           border-bottom: 1px solid #9EA2AB;
       }
       
       .unstructured-container {
           -webkit-box-flex: 0;
           -ms-flex: 0;
           flex: 0;
       }
       
       .structure, .numeric-text, .unstructured-text {
           text-align: center;
           color: #9EA2AB;
       }
       
       .numeric-container, .numeric-text {
           -webkit-box-flex: 0;
           -ms-flex: 0 0 65%;
           flex: 0 0 65%;
       }
       
       .unstructured-container, .unstructured-text {
           -webkit-box-flex: 0;
           -ms-flex: 0 0 28%;
           flex: 0 0 28%;
       }
       
       label.structure.checked {
           border-bottom: 2px solid #59247F;
       }
       
       .structure div {
           padding-bottom: 19px;
           color: #5C6373;
       }
       
       input.visualisation+img {
           margin-bottom: 10px;
           cursor: pointer;
       }
       
       input.visualisation {
           position: absolute;
           opacity: 0;
       }
       
       /*************************** step 3 ***************************/
       
       .valid-container {
           margin: 0 30px;
       }
       
       .valid-container .row {
           display: -webkit-box;
           display: -ms-flexbox;
           display: flex;
           -webkit-box-orient: horizontal;
           -webkit-box-direction: normal;
           -ms-flex-direction: row;
           flex-direction: row;
           line-height: 28px;
           border-bottom: 1px solid #e0e0e0;
           padding: 4px 0;
       }
       
       .valid-container .row.no-border {
           border: none
       }
       
       .valid-container .column1, .valid-container .column2 {
           display: -webkit-box;
           display: -ms-flexbox;
           display: flex;
           -webkit-box-align: center;
           -ms-flex-align: center;
           align-items: center;
           -webkit-box-flex: 1;
           -ms-flex: 1;
           flex: 1;
       }
       
       .valid-container .column2 {
           -ms-flex-pack: distribute;
           justify-content: space-around;
           -webkit-box-flex: 0;
           -ms-flex: 0;
           flex: 0;
       }
       
       .valid-container .column2 .quantity {

           border: none;
           border-radius: 4px;
           color: #5C6373;

           height: 28px;
           padding: 0 15px;
           margin-left: 15px;
           text-align: center;
       }
       
       .valid-container .column2 span {
           margin-left: 15px;
       }
       
       .valid-container .onoff {
           margin: 0 15px;
       }
       
       /*************************** step 4 ***************************/
       
       .details-container {

           display: -ms-flexbox;
           display: flex;

           -webkit-box-direction: normal;
           -ms-flex-direction: column;
           flex-direction: column;
           -webkit-box-pack: justify;
           -ms-flex-pack: justify;
           justify-content: space-between;
           width: 60%;
           margin: 0 auto;
       }
       
       .details-container .details-title {
           display: -webkit-box;
           display: -ms-flexbox;

           -ms-flex-pack: justify;
           justify-content: space-between;
           margin: 10px 0 5px 0;
       }
       
       .details-container input, .details-container textarea {

       .details-container .quest-text-input {

       /*************************** step 4 ***************************/

       .bk-accordion {
         height: 0;
         opacity: 0;
         padding: 0;
         z-index: 91;
         width: 100%;
         position: relative;
         background: #187D7B;
         -webkit-transition: all 1s ease-in-out;
         -khtml-transition: all 1s ease-in-out;
         -moz-transition: all 1s ease-in-out;
         -ms-transition: all 1s ease-in-out;
         -o-transition: all 1s ease-in-out;
         transition: all 1s ease-in-out;
       }
       .bk-accordion .bk-wrapper {
         overflow: hidden;
         position: relative;
         width: 100%;
         height: 100%;
         z-index: -1;
         background-color: #FFFFFF;
       }
       .bk-accordion .bk-wrapper .bk-loader {
         width: 100%;
         height: 100%;
         display: block;
         position: absolute;
         top: 0;
         left: 0;
         background: url(/resources/vivid/images/widget-loader.gif) center center no-repeat;
         background-color: #FFFFFF;
         opacity: 0.45;
         z-index: -1;
       }
       .bk-accordion.no-transition-resize {
         -webkit-transition: none;
         -khtml-transition: none;
         -moz-transition: none;
         -ms-transition: none;
         -o-transition: none;
         transition: none;
         background: #C8E5F8;
       }
       .bk-accordion.no-transition {
         -webkit-transition: none;
         -khtml-transition: none;
         -moz-transition: none;
         -ms-transition: none;
         -o-transition: none;
         transition: none;
       }
       .bk-accordion .bk-resize {
         position: absolute;
         height: 3px;
         width: 100%;
         cursor: row-resize;
         bottom: 1px;
       }
       .bk-accordion .bk-close {
         position: absolute;
         height: 16px;
         width: 16px;
         right: 5px;
         top: 5px;
         opacity: 1;
         filter: alpha(opacity=100);
         background-image: url(/systemPlugins/a06aad3590844d57a4275383ebe83c99.png);
       }
       .bk-accordion .bk-close:hover {
         opacity: 0.75;
         filter: alpha(opacity=75);
         cursor: pointer;
       }
       .bk-arrow {
         position: relative;
         background: #187D7B;
         opacity: 0;
         -webkit-transition: all 1s ease-in-out;
         -khtml-transition: all 1s ease-in-out;
         -moz-transition: all 1s ease-in-out;
         -ms-transition: all 1s ease-in-out;
         -o-transition: all 1s ease-in-out;
         transition: all 1s ease-in-out;
       }
       .bk-arrow:after {
         bottom: 100%;
         left: 50%;
         border: solid transparent;
         content: " ";
         height: 0;
         width: 0;
         position: absolute;
         pointer-events: none;
         border-color: rgba(0, 51, 170, 0);
         border-bottom-color: #187D7B;
         border-width: 15px;
         margin-left: -15px;
       }
       .widget-body.clickable {
         cursor: pointer;
       }
       
       div.accrdIcon > span {
         transform: rotate(90deg);
       }
       
       .accrdIcon {
         margin-top: 4px;
         order: -1;
       }
